In this section we will be discussing Pattern Matching . Pattern matching is a flexible mechanism that allows for validating the structure and type of the argument, while also destructing it to give easy access to what you need. Below are some examples of its common uses to match on branch conditions: fn match_input(n) { match n { 1 => println("The number one."), n if n is int => println(`Another number: {n}.`), [1, 2, n, ..] => println(`A vector starting with one and two, followed by {n}.`), "one" => println("One, but this time as a string."), _ => println("Something else. Can I go eat now?"), }
} fn main() { match_input(1); match_input(2); match_input([1, 2, 42, 84]); match_input("one"); match_input(#{field: 42});
} $> cargo run -- scripts/book/3_4/big_match.rn
The number one.
Another number: 2.
A vector starting with one and two, followed by 42.
One, but this time as a string.
Something else. Can I go eat now?
== Unit (5.691ms) We will be covering each of these variants in detail in the coming sections.

