In a pattern, every literal value can also be replaced with an ignore directive or a binding. The ignore directive looks like an underscore _, which tells rune to ignore the value, allowing it to have any value. fn test_ignore(vector) { match vector { [_, 2] => println("Second item in vector is 2."), }
} fn main() { test_ignore([1, 2]);
} $> cargo run -- scripts/book/3_4/ignore.rn
Second item in vector is 2.
== Unit (281.3µs) In contrast to ignoring, we cal also bind the value to a variable that is then in scope of the match arm. fn test_ignore(vector) { match vector { [_, b] => println(`Second item in vector is {b}.`), }
} fn main() { test_ignore([1, 2]);
} $> cargo run -- scripts/book/3_4/bind.rn
Second item in vector is 2.
== Unit (6.25ms) Here are some more examples: [_, a, b] which will ignore the first, but then capture the second and third element in the vector. {"name": name} will capture the name value out of the specified object. Finally we can also add the sequence .. to ask Rune to ignore any additional values in a collection that might be present when matching a vector or an object. fn describe_car(car) { match car { #{"make": year, ..} if year < 1950 => "What, where did you get that?", #{"model": "Ford", "make": year, ..} if year >= 2000 => "Pretty fast!", _ => "Can't tell 😞", }
} fn main() { println(describe_car(#{"model": "Ford", "make": 2000})); println(describe_car(#{"model": "Honda", "make": 1980})); println(describe_car(#{"model": "Volvo", "make": 1910}));
} $> cargo run -- scripts/book/3_4/fast_cars.rn
Pretty fast!
Can't tell 😞
What, where did you get that?
