Primitives are values stored immediately on the stack. In Rust terminology, these types are Copy, so reassigning them to different values will create distinct copies of the underlying value. The primitives available in rune are: the unit (). booleans, true and false. bytes, like b'\xff'. characters, like '今'. integers, like 42. floats, like 3.1418. You can see that these bytes are Copy, because assigning them to a different variable will cause a separate copy of the variable to be used. fn main() { let a = 1; let b = a; a = 2; println(`{a}`); println(`{b}`);
} $> cargo run -- scripts/book/4_1/copy.rn
2
1
